// AdminEducators.js
import React, { useState, useEffect } from 'react';
import api from './api';

function AdminEducators() {
  const [educators, setEducators] = useState([]);

  useEffect(() => {
    fetchEducators();
  }, []);

  async function fetchEducators() {
    try {
      const response = await api.get('/get-educators');
      const { data } = response;
      setEducators(data);
    } catch (error) {
      console.error('Error fetching educators:', error);
    }
  }

  return (
    <div>
      <h2>Educators</h2>
      <ul>
        {educators.map(educator => (
          <li key={educator.id}>{educator.name}</li>
        ))}
      </ul>
    </div>
  );
}

export default AdminEducators;
